import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int a = sc.nextInt();
        int b = sc.nextInt();

        double area = a * b;
        double tsubo = area / 3.305785;

        System.out.println(tsubo);
    }
}

