import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int[] coins = {500, 100, 50, 10, 5, 1};

        while (true) {
            int price = sc.nextInt();
            if (price == 0) break;

            int change = 1000 - price;
            int count = 0;

            for (int coin : coins) {
                count += change / coin;
                change %= coin;
            }

            System.out.println(count);
        }

        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int[] coins = {500, 100, 50, 10, 5, 1};
        while (true) {
            int price = sc.nextInt();
            if (price == 0) break;
            int change = 1000 - price;
            int count = 0;
            for (int coin : coins) {
                count += change / coin;
                change %= coin;
            }
            System.out.println(count);
        }
        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int W = sc.nextInt();
        int H = sc.nextInt();
        int x = sc.nextInt();
        int y = sc.nextInt();
        int r = sc.nextInt();

        if (x - r >= 0 && x + r <= W && y - r >= 0 && y + r <= H) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

