import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long A = sc.nextLong();
        long B = sc.nextLong();
        int K = sc.nextInt();

        for (int i = 0; i < K; i++) {
            if (i % 2 == 0) {
                if (A % 2 == 1) A--;
                long give = A / 2;
                A -= give;
                B += give;
            } else {
                if (B % 2 == 1) B--;
                long give = B / 2;
                B -= give;
                A += give;
            }
        }

        System.out.println(A + " " + B);
    }
}

