import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long a = sc.nextLong();
        long b = sc.nextLong();
        long x = sc.nextLong();

        long countB = b / x;
        long countA = (a == 0) ? 0 : (a - 1) / x;

        System.out.println(countB - countA);
    }
}

