import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] L = new int[2 * N];

        for (int i = 0; i < 2 * N; i++) {
            L[i] = sc.nextInt();
        }

        Arrays.sort(L);

        int total = 0;
        for (int i = 0; i < 2 * N; i += 2) {
            total += L[i];
        }

        System.out.println(total);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] L = new int[2 * N];
        for (int i = 0; i < 2 * N; i++) {
            L[i] = sc.nextInt();
        }
        Arrays.sort(L);
        int total = 0;
        for (int i = 0; i < 2 * N; i += 2) {
            total += L[i];
        }
        System.out.println(total);
    }
}
